INSERT INTO `pages` (`ID`, `Name`, `HTML`) VALUES
(1, 'Index', '<div class=\"Landing\"></div>\r\n<div class=\"Index\">\r\n     <h1>Index</h1>\r\n</div>'),
(2, 'Home', '<div class=\"Home\">\r\n            <h1>Egyptian Society of Analytic Chemistry</h1>\r\n            <div class=\"SympSlides fade\">\r\n                <img src=\"\' . URLROOT . \'/Public/img/H1.png\">\r\n            </div>\r\n            <div class=\"SympSlides fade\">\r\n                <img src=\"\' . URLROOT . \'/Public/img/H2.png\">\r\n            </div>\r\n            <div class=\"SympSlides fade\">\r\n                <img src=\"\' . URLROOT . \'/Public/img/H3.png\">\r\n            </div>\r\n            <div class=\"SympSlides fade\">\r\n                <img src=\"\' . URLROOT . \'/Public/img/H4.png\">\r\n            </div>\r\n            <div class=\"SympSlides fade\">\r\n                <img src=\"\' . URLROOT . \'/Public/img/H5.png\">\r\n            </div>\r\n            <div class=\"SympSlides fade\">\r\n                <img src=\"\' . URLROOT . \'/Public/img/H6.png\">\r\n            </div>\r\n            <div class=\"SympSlides fade\">\r\n                <img src=\"\' . URLROOT . \'/Public/img/H7.png\">\r\n            </div>\r\n            <div class=\"SympSlides fade\">\r\n                <img src=\"\' . URLROOT . \'/Public/img/H8.png\">\r\n            </div>\r\n            <div class=\"SympDot\">\r\n                <span class=\"dot\"></span>\r\n                <span class=\"dot\"></span>\r\n                <span class=\"dot\"></span>\r\n                <span class=\"dot\"></span> \r\n                <span class=\"dot\"></span> \r\n                <span class=\"dot\"></span> \r\n                <span class=\"dot\"></span> \r\n                <span class=\"dot\"></span> \r\n            </div>\r\n            <section>\r\n                <p id=\"par1\">\r\n                    The co-operation between Egypt and the Working Party of Analytical \r\n                    Chemistry (WPAC) of the Federation of European Chemical Societies (FECS) \r\n                    started rather early in the year 1979 when Professor Khater had the honor \r\n                    to be nominated by the Egyptian Chemical Society and Cairo University to \r\n                    represent Egyptas an observer in WPAC.One of the most important results of \r\n                    this sincere and friendly co-operation was the first International Symposium on New Trends in \r\n                    Chemistry, the role of Analytical Chemistry in National Development that \r\n                    was held at Cairo in January 1984 and supported by WPAC and TU Vienna.\r\n                    To conclude, the main goal of the Society is to stimulate the progress \r\n                    of Analytical Chemistry and to draw the attention of colleagues and \r\n                    decision makers to the importance of Analytical Chemistry for the welfare\r\n                    of Community and for a better life. We are honored and grateful for the\r\n                    support which we had got from the late Professors Dr. H. Khalifa and \r\n                    Dr. E. Khairy without which we could not have achieved any success.\r\n                </p>\r\n            </section>\r\n        </div>\r\n\r\n<script>\r\n    var slideIndex = 0;\r\n    showSlides();\r\n    function showSlides() {\r\n    var i;\r\n    var slides = document.getElementsByClassName(\"SympSlides\");\r\n    var dots = document.getElementsByClassName(\"dot\");\r\n    for (i = 0; i < slides.length; i++) {\r\n        slides[i].style.display = \"none\";  \r\n    }\r\n    slideIndex++;\r\n    if (slideIndex > slides.length) {slideIndex = 1}    \r\n    for (i = 0; i < dots.length; i++) {\r\n        dots[i].className = dots[i].className.replace(\" Sactive\", \"\");\r\n    }\r\n    slides[slideIndex-1].style.display = \"block\";  \r\n    dots[slideIndex-1].className += \" Sactive\";\r\n    setTimeout(showSlides, 2000); // Change image every 2 seconds\r\n    }\r\n</script>'),
(3, 'About', ' <div class=\"About\">\r\n            <h1>About EGSAC</h1>\r\n            <section>\r\n                <p>\r\n                    The co-operation between Egypt and the Working Party of Analytical Chemistry (WPAC) of the\r\n                    Federation of European Chemical Societies (FECS) started rather early in the year 1979 \r\n                    when I had the honor to be nominated by the Egyptian Chemical Society and Cairo University \r\n                    to represent Egypt as an observer in WPAC. Prof. H. Malissa, the chairman of the WPAC \r\n                    suggested an expanded scientific co-operation. We had many meetings together with \r\n                    Prof. R. Kellner as the secretary and Prof. M. Grasserbauer in the TU Vienna. \r\n                    The discussions were about the transfer of knowledge between north and south and how \r\n                    both sides would benefit from such cooperation. One of the most important results of this \r\n                    sincere and friendly co-operation was the first International Symposium on New Trends in \r\n                    Chemistry, the role of Analytical Chemistry in National Development that was held at \r\n                    Cairo in January 1984 and supported by WPAC and TU Vienna. Pronounced scientific support \r\n                    was established by the presence of ten professors who were members of the WPAC, \r\n                    representing Austria, Belgium, Finland, Germany, Hungary and United Kingdom. It was a \r\n                    very successful broad spectrum Analytical Symposium which aimed to draw the attention of \r\n                    decision makers in Egypt about the importance of Analytical Chemistry in all aspects of life. \r\n                    The recommendations of this Symposium were then circulated to all interested and important groups.\r\n                    According to one of the recommendations, the Egyptian Society of Analytical Chemistry was founded \r\n                    and registered in 1986. In addition, annual publication of the Egyptian Journal of Analytical\r\n                    Chemistry (EJAC) began. It is abstracted in both the Analytical and Chemical Abstracts. Volume \r\n                    25 is now in the final preparation. The success of the first symposium encouraged us to \r\n                    process the following volumes in 1989, 1994, 1997, 2000, 2003 and 2006... The support and \r\n                    co-operation of the WPAC continued. I was honored to be elected several times as the \r\n                    Chairperson of the Egyptian Society for Analytical Chemistry and to see its growing \r\n                    success. The support of Egyptian, Arabic and European friends and colleagues members of \r\n                    the Scientific Community who showed real understanding for scientific achievements and \r\n                    that we have to co-operate to keep it in the best living conditions for new generations \r\n                    to come. Since the start of the activity of the Egyptian Society of Analytical Chemistry \r\n                    (ESAC) our interest was to strengthen the co-operation between Analytical Chemists in\r\n                    Egypt with Arabic and African colleagues so we joined the Arabic Union of Chemists in 1998 \r\n                    becoming an active member. In 2006 we shared in founding the African Federation of Societies \r\n                    of Chemistry (FASC), of which I am honored being the Vice chairperson of the Federation.\r\n                    To conclude, the main goal of the Society is to stimulate the progress of Analytical Chemistry \r\n                    and to draw the attention of colleagues and decision makers to the importance of \r\n                    Analytical Chemistry for the welfare of Community and for a better life. We are honored \r\n                    and grateful for the support which we had got from the late Professors Dr. H. Khalifa \r\n                    and Dr. E. Khairy without which we could not have achieved any success. Thanks are due \r\n                    to all Rectors of Cairo University, Presidents of the Egyptian Academy of Science and \r\n                    research from 1984 till now for their understanding and support.\r\n                </p>\r\n            </section>\r\n        </div>'),
(4, 'Journal', '<h1>JOURNAL</h1>'),
(5, 'Symposia', '<h1>SYMPOSIA</h1>'),
(6, 'Contact', '<div class=\"Contact\">\r\n            <h1>Contact Us</h1>\r\n            <span>\r\n                <h3>Prof. Dr. M.M.Khater</h3> \r\n                <div class=\"info\">\r\n                    Mobile: 012239523 <br> Office: 0235676559 <br> Email: motazamohamed.khater@yahoo.com \r\n                </div>\r\n            </span>\r\n            <span>\r\n                <h3>Prof.Dr. Y.M.Issa</h3> \r\n                <div class=\"info\">\r\n                    Mobile: 01005600793 <br> Office: 0235676579 <br> Email: yousrymi@yahoo.com\r\n                </div>\r\n            </span>\r\n            <span> \r\n                <h3>Prof.Dr. M.A.Zayed</h3> \r\n                <div class=\"info\">\r\n                    Mobile: 01005776675 <br> Office: 0235676624 <br> Email: mazayed429@yahoo.com\r\n                </div>\r\n            </span>\r\n        </div>'),
(7, 'Header', '<!DOCTYPE html>\r\n<html lang=\"en\">\r\n\r\n    <head>\r\n        <title>EGSAC</title>\r\n\r\n        <meta charset=\"UTF-8\">\r\n        <meta http-quive=\"Cache-control\" content=\"no-cache\">\r\n        <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">'),
